import React from 'react'
import { Link } from 'react-router-dom';
import { PageLinks, Button } from './';
import logo from '../images/shared/desktop/logo.svg';

const Navbar = () => {
    return (
        <div className="navbar">
            <Link to="/">
                <img className="navbar__logo" src={logo} alt="Photosnap company logo" />
            </Link>
            <div className="navbar__links">
                <PageLinks />
            </div>
            <Button text="Get an invite" />
            <a href="#" className="navbar__mobile" aria-label="Button for mobile menu deployment">
                <svg className="navbar__mobile" xmlns="http://www.w3.org/2000/svg" width="20" height="6">
                    <g fill-rule="evenodd"><path d="M0 0h20v1H0zM0 5h20v1H0z"/></g>
                </svg>
            </a>
        </div>
    )
}

export default Navbar
